// AboutMe.js
import React from 'react';
import styled from 'styled-components';
import EducationIcon from './assets/education.svg'
import HobbyIcon from './assets/hobby.svg'
import TeachingIcon from './assets/teaching.svg'

const PageContainer = styled.div`
  height: calc(100vh - 78px);
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
`;

const SectionTitle = styled.h2`
  font-size: 24px;
  margin-bottom: 20px;
`;

const ColumnsContainer = styled.div`
  display: flex;
  flex-direction: column; /* Display columns in a column on small screens */
  gap: 20px; /* Add space between columns */
  height: 80%;
  width: 90%;
  margin-top: 20px;

  @media screen and (min-width: 768px) {
    flex-direction: row; /* Display columns in a row on larger screens */
  }
`;

const Column = styled.div`
  flex: 1;
  background-color: #f2f2f2;
  border-radius: 10px;
  padding: 20px;
`;

const AboutMe = () => {
  return (
    <PageContainer>
      <SectionTitle>About Me</SectionTitle>
      <ColumnsContainer>
        <Column>
        <div style={{display:'flex'}}>
        <img src={EducationIcon} />
          <p>Education</p>
        </div>

        </Column>
        <Column>
          <img src={TeachingIcon} />
          <p>Teaching</p>
        </Column>
        <Column>
          <img src={HobbyIcon} />
          <p>Hobbies</p>
        </Column>
      </ColumnsContainer>
    </PageContainer>
  );
};

export default AboutMe;
